import React from 'react';

const Weather = (props) => {
        console.log(props.weather)
const hello = () => {
    if(props.weather !== undefined){
        return(
            <>
                <h1>Date: {props.weather.applicable_date}</h1>
                <h1>Maximum Temperature :{props.weather.max_temp}</h1>
            </>
        )}
      else{
          return (
            <p>Enter a Location Name</p>
            );
      }
}
return(
    <>
    <div>
        {this.hello()}
    </div>
    </>
)

}

export default Weather;
